import React from 'react';
import './user-address.styles.css';

class UserAddress extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            user: {
                "id": 6,
                "name": "Mrs. Dennis Schulist",
                "email": "Karley_Dach@jasper.info",
                "age": 40,
                "address": [
                    {
                        "street": "Norberto Crossing",
                        "suite": "Apt. 950",
                        "city": "South Christy",
                        "zipcode": "23505-1337"
                    },
                    {
                        "street": "Hoeger Mall",
                        "suite": "Apt. 692",
                        "city": "South Elvis",
                        "zipcode": "53919-4257"
                    },
                    {
                        "street": "Victor Plains",
                        "suite": "Suite 879",
                        "city": "Wisokyburgh",
                        "zipcode": "90566-7771"
                    }
                ],
                "phone": "1-477-935-8478 x6430"
            }
        }
    }
    render() {
        return (
            <div>
                {
                    this.state.user.address.map( (add, index) => {
                        return (
                            <div className="card border-secondary mb-3" key={add.zipcode}>
                                <div className="card-header">Address {index + 1}</div>
                                <div className="card-body text-secondary">
                                    <table class="table table-sm table-borderless">
                                        <tbody>
                                            <tr>
                                                <td>Street</td>
                                                <td>{add.street}</td>
                                            </tr>
                                            <tr>
                                                <td>Suite</td>
                                                <td>{add.suite}</td>
                                            </tr>
                                            <tr>
                                                <td>City</td>
                                                <td>{add.city}</td>
                                            </tr>
                                            <tr>
                                                <td>Zipcode</td>
                                                <td>{add.zipcode}</td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        );
                    })
                }
                <div className="card border-secondary mb-3">
                    <div className="card-header">Address</div>
                    <div className="card-body text-secondary">
                        <h5 className="card-title">Secondary card title</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>
                <div className="card border-secondary mb-3">
                    <div className="card-header">Address</div>
                    <div className="card-body text-secondary">
                        <h5 className="card-title">Secondary card title</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                </div>
            </div>
        );
    }
};

export default UserAddress;
